    /**
 * 判断点是否在多边形内部（射线法）
 * @param {Array} point 点坐标 [经度, 纬度]
 * @param {Array} polygon 多边形坐标数组，每个元素为[经度, 纬度]
 * @return {Boolean} 是否在内部
 */
    function pointInPolygon(point, polygon) {
        const [x, y] = point;
        const n = polygon.length;
        let inside = false;

        for (let i = 0, j = n - 1; i < n; j = i++) {
            const [xi, yi] = polygon[i];
            const [xj, yj] = polygon[j];

            // 检查点是否在多边形的边上或内部
            const intersect = ((yi > y) !== (yj > y)) &&
                  (x < (xj - xi) * (y - yi) / (yj - yi) + xi);
            if (intersect) {
                inside = !inside;
            }
        }

        return inside;
    };
    function getCityByCoordinate(lng, lat, geojsonData) {
        const point = [lng, lat];

        // 遍历所有城市特征
        for (const feature of geojsonData.features) {
            const cityName = feature.properties.name;
            const geometry = feature.geometry;

            // 处理MultiPolygon类型（多个多边形）
            if (geometry.type === 'MultiPolygon') {
                for (const polygon of geometry.coordinates) {
                    // GeoJSON的坐标是三维数组，提取二维坐标
                    const simplifiedPolygon = polygon[0].map(coord => [coord[0], coord[1]]);
                    if (pointInPolygon(point, simplifiedPolygon)) {
                        return cityName;
                    }
                }
            }
            // 处理Polygon类型（单个多边形）
            else if (geometry.type === 'Polygon') {
                const simplifiedPolygon = geometry.coordinates[0].map(coord => [coord[0], coord[1]]);
                if (pointInPolygon(point, simplifiedPolygon)) {
                    return cityName;
                }
            }
        }

        return null; // 不在任何城市范围内
    };

